import './cartItem.css'

const CartItem = props =>{
    return <div className='cartItemContainer'>
        <div className='cartItemInfo'>
            {props.name}
            {props.price}
            {props.amount}
        </div>
        <div className='twoButtons'>
            <button>-</button>
            <button>+</button>
        </div>
    </div>

}

export default CartItem
